import React from 'react' 
import {AppBar, Toolbar} from '@mui/material';

import {Menu as MenuIcon} from '@mui/icons-material'

function Header() {
  return (
    <div>
      <AppBar  position='static'>
        <Toolbar>
            <MenuIcon></MenuIcon>
        </Toolbar>
      </AppBar>
    </div>
  )
}

export default Header
